function timeElapsed(e, t) {
  if (!t) {
    t = '10sec';
  }
  if (!e) return !1;
  switch (
    (t = {
      length: parseInt(t),
      type: t.split(parseInt(t))[1].toLocaleLowerCase(),
      dnow: Date.now(),
    }).type
  ) {
    case 'sec':
      t.length *= 1e3;
      break;
    case 'min':
      t.length *= 6e4;
      break;
    case 'hrs':
      t.length *= 36e5;
      break;
    case 'days':
      t.length *= 864e5;
      break;
    case 'mon':
      t.length *= 2592e6;
      break;
    case 'yrs':
      t.length *= 31104e6;
  }
  return e + t.length - t.dnow < 0;
}
